  providedIn: 'root'
})
export class EventsService {

  uri: 'http://localhost:3000/api' = "http://localhost:3000/api";

  constructor(private _http: HttpClient) { }
  createevent(data:any){
    return this._http.post('http://localhost:3000/events',data)
  }

}
